    "# Définir la fonction pour la reconnaissance de la parole\n",
    "def recognize_speech(audio_data):\n",
    "    # Charger les données audio avec torchaudio\n",
    "    waveform, sample_rate = torchaudio.load(audio_data)\n",
    "    # Calculer le Mel spectrogram\n",
    "    spectrogram = T.MelSpectrogram(\n",
    "        sample_rate=sample_rate,\n",
    "        n_fft=2048,\n",
    "        hop_length=256,\n",
    "        n_mels=64,  # Réduction du nombre de filtres Mel\n",
    "        normalized=True)(waveform)\n",
    "    \n",
    "    \n",
    "    with torch.no_grad():\n",
    "        output = model(spectrogram)\n",
    "        output_class = torch.argmax(output, dim=1) \n",
    "\n",
    "    # Récupérer l'indice de la classe prédite\n",
    "    predicted_index = output_class\n",
    "    # Liste des mots\n",
    "    word_list = ['bed', 'bird', 'cat', 'dog', 'down', 'eight', 'five',\n",
